import{_ as e,o as r,c as t,O as o}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 18.2-192 Credit card theft.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-192.md","filePath":"vacode/18.2-192.md"}'),a={name:"vacode/18.2-192.md"},i=o('<h1 id="§-18-2-192-credit-card-theft" tabindex="-1">§ 18.2-192 Credit card theft. <a class="header-anchor" href="#§-18-2-192-credit-card-theft" aria-label="Permalink to &quot;§ 18.2-192 Credit card theft.&quot;">​</a></h1><p>(1) A person is guilty of credit card or credit card number theft when:</p><p>(a) He takes, obtains or withholds a credit card or credit card number from the person, possession, custody or control of another without the cardholder&#39;s consent or who, with knowledge that it has been so taken, obtained or withheld, receives the credit card or credit card number with intent to use it or sell it, or to transfer it to a person other than the issuer or the cardholder; or</p><p>(b) He receives a credit card or credit card number that he knows to have been lost, mislaid, or delivered under a mistake as to the identity or address of the cardholder, and who retains possession with intent to use, to sell or to transfer the credit card or credit card number to a person other than the issuer or the cardholder; or</p><p>(c) He, not being the issuer, sells a credit card or credit card number or buys a credit card or credit card number from a person other than the issuer; or</p><p>(d) He, not being the issuer, during any twelve-month period, receives credit cards or credit card numbers issued in the names of two or more persons which he has reason to know were taken or retained under circumstances which constitute a violation of § <a href="http://law.lis.virginia.gov/vacode/18.2-194/" target="_blank" rel="noreferrer">18.2-194</a> and subdivision (1) (c) of this section.</p><p>(2) Credit card or credit card number theft is grand larceny and is punishable as provided in § <a href="http://law.lis.virginia.gov/vacode/18.2-95/" target="_blank" rel="noreferrer">18.2-95</a>.</p><p>Code 1950, § 18.1-125.3; 1968, c. 480; 1975, cc. 14, 15; 1976, c. 318; 1985, c. 266.</p>',8),d=[i];function s(n,c,h,l,p,u){return r(),t("div",null,d)}const m=e(a,[["render",s]]);export{f as __pageData,m as default};
